import React from 'react';

function CustomFooter() {
  return (
    <footer className="page-footer footer-color">
      <div style={{
        fontSize: '20px', paddingLeft: '30px', paddingTop: '10px', paddingBottom: '40px',
      }}
      />
    </footer>
  );
}

export default CustomFooter;
